import Project from "./project";

class Projects extends Component {
  state = {
    projectList: [
      {
        uid: "0",
        shortname: "salespath"
      },
      {
        uid: "1",
        shortname: "grubhub"
      },
      {
        uid: "2",
        shortname: "gospace"
      }
    ]
  };
  render() {
    return this.state.projectList.map(p => {
      console.log(p);
    });
  }
}

export default Projects;
